import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { BrowserRouter as Router } from 'react-router-dom';
import App from './App';
import {  createTheme } from '@mui/material/styles';


ReactDOM.render(
  <Router>
    <App />
  </Router>,
  document.getElementById('root')
);
